export default () => {
  const comparisonColdef = [{
      Header: "Scenario",
      accessor: "scenario",
      width: 50,
      align: "left",
    },
    {
      Header: "Sell Through %",
      accessor: "Sell Through %",
      width: 50,
      align: "left",
    },
    {
      Header: "Margin %",
      accessor: "Margin %",
    },
    {
      Header: "AUR ($)",
      accessor: "AUR ($)",
    },
    {
      Header: "AUM ($)",
      accessor: "AUM ($)",
    },
    {
      Header: "MD Budget Utilises ($)",
      accessor: "MD budget Utilised($)",
    },
    {
      Header: "Left Over Inventory",
      accessor: "Left OVer Inventory",
    },
    {
      Header: "Revenue ($)",
      accessor: "Revenue ($)",
    },
    {
      Header: "Margin ($)",
      accessor: "Margin ($)",
    },
    {
      Header: "Units",
      accessor: "Units",
    },
  ];
  return comparisonColdef;
};
